export interface DesignNode {
    id: string;
    name: string;
    type: string;
    absoluteBoundingBox: Rect;
    fills: Paint[];
    strokes: Paint[];
    characters: string | undefined;
    children: DesignNode[] | undefined;
}
export type NodeId = string;
export type DesignNodeDict = Record<NodeId, DesignNode | undefined>;
export type DesignNodeUpdatePackets = Record<NodeId, DesignUpdatePacket>;
type DesignUpdatePacket = {
    type: 'UPDATE';
    design: DesignNode;
} | {
    /**Used to say the node exists but hasnt been parsed yet */
    type: 'PENDING';
} | {
    type: 'DELETE';
};
export {};
